import React, { useState , useEffect} from 'react';
import ExercisesData from './Ex.json';
import './App.css'

const Exercises = () => {
  const [Data, setData] = useState([]);

  useEffect(()=>{

setData(ExercisesData.exercises)


  },[])

  return (
    <div className='container21'>
      <h1 className='head1'>Exercises</h1>
      <ul>
        {Data.map((exercise, index) => (
          <li key={index}>
            <h2 className='exname'>{exercise.name}</h2>
            <p >Description: {exercise.description}</p>
            <p>Muscle Groups: {exercise.muscleGroups.join(', ')}</p>
            <p>Video Link: <a href={exercise.videoLink} target="_blank" rel="noopener noreferrer">Watch Video</a></p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Exercises;
